import React, { useState } from "react";
import { Form, Button, Alert, Card, Spinner } from "react-bootstrap";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const Login = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
  });
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const { login } = useAuth(); // Get login function from context
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setLoading(true);

    try {
      const response = await login(formData.email, formData.password);

      if (response.success) {
        navigate("/");
      } else {
        setError(response.error);
      }
    } catch (err) {
      setError("An unexpected error occurred");
    } finally {
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div className="d-flex justify-content-center align-items-center min-vh-100 bg-light">
      <Card
        className="shadow-lg border-0 rounded"
        style={{ maxWidth: "400px", width: "95%" }}
      >
        <Card.Header className="bg-primary text-white text-center py-2">
          <h3 className="fw-bold m-0">Login</h3>
        </Card.Header>
        <Card.Body className="p-3">
          {error && (
            <Alert variant="danger" className="py-2 mb-3 small">
              <i className="bi bi-exclamation-triangle-fill me-1"></i>
              {error}
            </Alert>
          )}

          <Form onSubmit={handleSubmit} className="compact-form">
            <Form.Group className="mb-2" controlId="formEmail">
              <Form.Label className="fw-medium small mb-1">Email</Form.Label>
              <Form.Control
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="Enter your email"
                required
                className="py-1 shadow-sm"
                size="sm"
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formPassword">
              <Form.Label className="fw-medium small mb-1">Password</Form.Label>
              <Form.Control
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                placeholder="Enter your password"
                required
                className="py-1 shadow-sm"
                size="sm"
              />
            </Form.Group>

            <Button
              variant="primary"
              type="submit"
              disabled={loading}
              className="w-100 py-1 mb-2 fw-medium"
              size="sm"
            >
              {loading ? (
                <>
                  <Spinner
                    as="span"
                    animation="border"
                    size="sm"
                    role="status"
                    aria-hidden="true"
                    className="me-1"
                    style={{ width: "0.8rem", height: "0.8rem" }}
                  />
                  Logging in...
                </>
              ) : (
                "Login"
              )}
            </Button>
          </Form>

          <div className="text-center mt-2">
            <small>
              Don't have an account?{" "}
              <Link
                to="/register"
                className="text-primary text-decoration-none fw-bold"
              >
                Register
              </Link>
            </small>
          </div>
        </Card.Body>
        <Card.Footer className="text-center py-2 bg-light">
          <span className="x-small text-muted">
            Forgot your password?{" "}
            <a href="#" className="text-primary text-decoration-none">
              Reset
            </a>
          </span>
        </Card.Footer>
      </Card>
    </div>
  );
};

export default Login;
